async function script () {
    const conn = await createConnection();
    // ensure schema is up-to-date
    await conn.synchronize();
    console.log("DB schema is now up-to-date!");

    for (const categoryNom of categoryNominations) {
        const category = await Category.findOne(categoryNom.category);

        if (!category) {
            throw new Error("Category not found!");
        }

        // Delete any existing nominations in category
        const catNoms = await Nomination.find({ category });
        await Promise.all(catNoms.map(nom => nom.remove()));

        // Import nominations into category
        for (const nom of categoryNom.nominations) {
            const nomination = new Nomination();
            nomination.category = category;
            if (nom.beatmap) {
                const map = await Beatmap.findOne(nom.beatmap.ID);
                nomination.beatmap = map;
            } else if (nom.beatmapset) {
                const set = await Beatmapset.findOne(nom.beatmapset.ID);
                nomination.beatmapset = set;
            } else if (nom.user) {
                let user = await User.findOne({
                    osu: { 
                        userID: nom.user.osuID, 
                    },
                });
                if (!user) {
                    user = new User;
                    user.country = "";
                    user.osu = {
                        userID: nom.user.osuID,
                        username: nom.user.osuUsername,
                    } as OAuth;
                    
                    await user.save();
                }
                nomination.user = user;
            } else {
                throw new Error("Nomination has no beatmapset, beatmap or user!");
            }

            nomination.isValid = nom.isValid;
            if (nom.reviewer) {
                let reviewer = await User.findOne({
                    osu: {
                        username: nom.reviewer,
                    },
                });
                if (!reviewer) {
                    reviewer = new User;
                    reviewer.country = "";
                    reviewer.osu = {
                        username: nom.reviewer,
                    } as OAuth;

                    await reviewer.save();
                }
                nomination.reviewer = reviewer;
                nomination.lastReviewedAt = new Date(nom.lastReviewedAt);
            }

            nomination.nominators = [];
            for (const nomUser of nom.nominators) {
                let nominator = await User.findOne({
                    osu: { 
                        userID: nomUser.osuID, 
                    },
                });

                if (!nominator) {
                    nominator = new User;
                    nominator.country = "";
                    nominator.osu = {
                        userID: nomUser.osuID,
                        username: nomUser.osuUsername,
                    } as OAuth;
                    
                    await nominator.save();
                }
                nomination.nominators.push(nominator);
            }

            await nomination.save();
        }
    }
}

if(module === require.main) {
    script()
        .then(() => {
            console.log("Script completed successfully!");
            process.exit(0);
        })
        .catch((err: Error) => {
            console.error("Script encountered an error!");
            console.error(err.stack);
            process.exit(1);
        });
}